import React from 'react'
import { Helmet } from 'react-helmet'

const MetaData = ({ title }) => {
    return (
        <>
            <Helmet>
                <title>{`${title} - DCT19A`}</title>
                <noscript></noscript>
            </Helmet>
        </>

    )
}

export default MetaData
